import React, {Component} from 'react';
import {getUserData} from "../api/UserData";

class LockList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            data: []
          };
    }

    reloadUserData = () => {
        getUserData("11").then((data) => {
            this.setState({'data': data});
        });
    };

    clickHandler(){
        this.reloadUserData();
    }


    render() {

        const smth = this.state.data;
        return (
            <div>
                <label><b>{String(smth)}</b></label>
                <button type="submit" class="btn btn-default" onClick={ this.reloadUserData()}>Получить список замочков</button>
            </div>
        );
    }
}

export default LockList;
